    ContractSearchComponent.prototype.getBackEndDataAfterDelete = function (findButton) {
        var _this = this;
        this.spinner.showSpinner();
        var backendData = this._joborderService.getData(this.simpleContSearchData);
        backendData.subscribe(function (data) {
            if (data == "userSessionExpired") {
                _this._sessionTimeOutService.checkSessionTimeout(data);
            }
            else if (data.hasOwnProperty("errorCode")) {
                if (data["errorCode"] = "IJS_EX_10001") {
                    _this.changeFind();
                }
                else {
                    _this.errorCodetext = _this._serverErrorCode.checkError(data["errorCode"]);
                    UIkit.modal('#errorCodeShow-Modal').show();
                }
            }
            else {
                _this.tableDataContractSearch1 = data;
                _this.addRemoveSortFilter(_this.filterDataSelectedComp, _this.tableDataContractSearch1);
                _this.calCPages();
                _this.hideResults = true;
            }
            _this.selectedContractArray = [];
            _this.numberOFRowSelected = 0;
            _this.selectedRow = undefined;
            _this.selectAllCheckBox.checked = false;
            _this.spinner.hideSpinner();
            if (findButton !== undefined)
                findButton.innerHTML = '<i class="fa fa-search"></i> <span>&nbsp;FIND</span>';
        }, function (err) {
            _this.spinner.hideSpinner();
            // A client-side or network error occurred. Handle it accordingly.
            findButton.innerHTML = '<i class="fa fa-search"></i> <span>&nbsp;FIND</span>';
            _this.serverErrorCodetext = "There is DB connection issue.Please try again.";
            UIkit.modal('#serverErrorCodeModal').show();
        });
    };
