    //changes for getting selectedContractData
    NewContractComponent.prototype.getSelectedContractData = function (index) {
        var _this = this;
        /**
         * logic for getting transport mode, terms and fsc code in single request
         * plus all the data related to the selected contract
         *
         */
        this._spinner.showSpinner();
        var backendResult = this._newContractService.getData({ action: 'getSelectedContractData',
            vendorCode: this.newContractData.contract["vendorCode"],
            contract: {
                locType: "TO_LOC_TYPE",
                fromLocType: this.newContractData.contract.locations[index]['fromLocType'],
                fromLocation: this.newContractData.contract.locations[index]['fromLocation'],
                toLocType: this.newContractData.contract.locations[index]['toLocType'],
                toLocation: this.newContractData.contract.locations[index]['toLocation'],
                transMode: this.newContractData.contract['transMode']
            } });
        backendResult.subscribe(function (data) {
            if (data == "userSessionExpired") {
                _this._sessionTimeOutService.checkSessionTimeout(data);
            }
            else if (data.hasOwnProperty("errorCode")) {
                _this.spinner.hideSpinner();
                if (data["errorCode"] == "IJS_COMM_SETUP_EX_1001") {
                    _this.toLocationErrFlag = true; //#NIIT CR5 
                    _this.newContractData.contract.locations[index]['toLocationErr'] = "false";
                    _this.newContractData.contract.locations[index]['toLocationErrorTextMsg'] = _this._serverErrorCode.checkError("IJS_COMM_SETUP_EX_1001");
                    //getting the transport mode
                    if (data["transportModeList"] != undefined && data["transportModeList"].length > 0) {
                        for (var i = 0; i < data["transportModeList"].length; i++) {
                            _this.selectOptionsForTransport.push({ label: data["transportModeList"][i]["label"], value: data["transportModeList"][i]["value"], code: data["transportModeList"][i]["code"] });
                        }
                    }
                    _this.newContractData.contract['transMode'] = _this.newContractData.contract['transModeforEdit'];
                    //getting the term list
                    if (data["termList"]) {
                        for (var i = 0; i < data["termList"].length; i++) {
                            _this.termCodesList.push({ label: data["termList"][i]["termCode"], value: data["termList"][i]["termCode"] });
                            _this.termCodesList.sort(function (a, b) { return (a.value > b.value) ? 1 : ((b.value > a.value) ? -1 : 0); }); //to sort the term code list
                        }
                    }
                }
                else if (data["errorCode"] == "IJS_EX_10047") {
                    _this.errorTextMsg = _this._serverErrorCode.checkError("IJS_EX_10047");
                    _this.errorField = false; //to show error below vendor         
                    _this.newContractData.contract["vendorName"] = "";
                    //getting the fsc currency
                    if (data["fscCurrencyList"]) {
                        _this.newContractData.contract.locations[index]['currency'] = data["fscCurrencyList"][0]["currencyCode"];
                    }
                    //getting the term list
                    if (data["termList"]) {
                        for (var i = 0; i < data["termList"].length; i++) {
                            _this.termCodesList.push({ label: data["termList"][i]["termCode"], value: data["termList"][i]["termCode"] });
                            _this.termCodesList.sort(function (a, b) { return (a.value > b.value) ? 1 : ((b.value > a.value) ? -1 : 0); }); //to sort the term code list
                        }
                    }
                }
                else if (data["errorCode"] == "IJS_TRANS_CURR_ERROR") {
                    _this.toLocationErrFlag = true; //#NIIT CR5 
                    _this.newContractData.contract.locations[index]['toLocationErr'] = "false";
                    _this.newContractData.contract.locations[index]['toLocationErrorTextMsg'] = _this._serverErrorCode.checkError("IJS_COMM_SETUP_EX_1001");
                    _this.errorTextMsg = _this._serverErrorCode.checkError("IJS_EX_10047");
                    _this.errorField = false; //to show error below vendor         
                    _this.newContractData.contract["vendorName"] = "";
                    //getting the term list
                    if (data["termList"]) {
                        for (var i = 0; i < data["termList"].length; i++) {
                            _this.termCodesList.push({ label: data["termList"][i]["termCode"], value: data["termList"][i]["termCode"] });
                            _this.termCodesList.sort(function (a, b) { return (a.value > b.value) ? 1 : ((b.value > a.value) ? -1 : 0); }); //to sort the term code list
                        }
                    }
                }
            }
            else {
                _this.errorField = true;
                //getting the vendor name
                if (data["vendorName"]) {
                    _this.newContractData.contract["vendorName"] = data["vendorName"];
                }
                //getting the fsc currency
                if (data["fscCurrencyList"]) {
                    _this.newContractData.contract.locations[index]['currency'] = data["fscCurrencyList"][0]["currencyCode"];
                }
                //getting the transport mode
                if (data["transportModeList"] != undefined && data["transportModeList"].length > 0) {
                    for (var i = 0; i < data["transportModeList"].length; i++) {
                        _this.selectOptionsForTransport.push({ label: data["transportModeList"][i]["label"], value: data["transportModeList"][i]["value"], code: data["transportModeList"][i]["code"] });
                    }
                }
                _this.newContractData.contract['transMode'] = _this.newContractData.contract['transModeforEdit'];
                //  this.newContractData.contract["EditOnOff"]=true;
                //getting the term list
                if (data["termList"]) {
                    for (var i = 0; i < data["termList"].length; i++) {
                        _this.termCodesList.push({ label: data["termList"][i]["termCode"], value: data["termList"][i]["termCode"] });
                        _this.termCodesList.sort(function (a, b) { return (a.value > b.value) ? 1 : ((b.value > a.value) ? -1 : 0); }); //to sort the term code list
                    }
                }
                _this._spinner.hideSpinner();
            }
        });
    };
