    JoMaintenanceSearchComponent.prototype.getBackEndData = function (findButton) {
        var _this = this;
        this.spinner.showSpinner();
        this.maintainJoSearchData['action'] = 'maintainJoSearch';
        if (this.componentType == 'jomaintenance') {
            this.maintainJoSearchData.maintainJoParam['componentType'] = 'JOMAINTENANCE';
        }
        this.maintainJoSearchData.maintainJoParam['pageNo'] = 1;
        this.maintainJoSearchData.maintainJoParam['requestChanged'] = true;
        this.maintainJoSearchData.maintainJoParam['noOfRecPerPage'] = 10;
        var searchObj = this.maintainJoSearchData;
        var backendData = this._maintenanceService.getMaintenanceData(searchObj);
        backendData.subscribe(function (data) {
            if (data == "userSessionExpired") {
                _this._sessionTimeOutService.checkSessionTimeout(data);
            }
            else if (data.hasOwnProperty("errorCode")) {
                _this.errorCodetext = _this._serverErrorCode.checkError(data["errorCode"]);
                _this.errormessage = false;
                if (_this.errorCodetext == undefined) {
                    _this.errorCodetext = "There is an issue on DB connection,  Please try again.";
                }
                //UIkit.modal('#maintainjo-error-code-modal').show();
            }
            else {
                _this.tableDataMaintenanceJoSearch1 = data;
                var searchInputOutPutData = {
                    "filterInputData": _this.filterDataSelectedComp,
                    "searchInputData": _this.maintainJoSearchData,
                    //"searchOutputData": this._sortTable.sortTableData(this.tableDataMaintenanceJoSearch1, this.filterDataSelectedComp.sortIn, this.filterDataSelectedComp.orderBy),
                    "searchOutputData": _this._sortTable.sortTableData(_this.tableDataMaintenanceJoSearch1.searchResult.result, _this.filterDataSelectedComp.sortIn, _this.filterDataSelectedComp.orderBy),
                    "jobOrdTypeText": _this.jobOrdTypeText,
                    "jobOrdStsText": _this.jobOrdStsText,
                    "totalRecords": _this.tableDataMaintenanceJoSearch1.totalRecords,
                    "checkSocCocType": _this.maintainJoSearchData.maintainJoParam.SocOrCoc
                };
                _this.searchDataJoInquiry.emit(searchInputOutPutData);
            }
            _this.spinner.hideSpinner();
            if (findButton !== undefined)
                findButton.innerHTML = '<i class="fa fa-search"></i> <span>&nbsp;FIND</span>';
        }, function (err) {
            _this.spinner.hideSpinner();
            // A client-side or network error occurred. Handle it accordingly.
            findButton.innerHTML = '<i class="fa fa-search"></i> <span>&nbsp;FIND</span>';
            _this.errorCodetext = "There is an issue on DB connection,  Please try again.";
            _this.errormessage = false;
            //UIkit.modal('#maintainjo-error-code-modal').show();
        });
    };
