    JoMaintenanceresultTableComponent.prototype.filterDataOnPageChange = function (records) {
        this.checkBoxFilterArray = this.filterOptions;
        var newcbArray = this.checkBoxFilterArray;
        var tableData = records;
        newcbArray.forEach(function (element) {
            if (!element.selected) {
                if (element.id == 'SOCorCOC') {
                    tableData = tableData.filter(function (obj) {
                        return (element.name !== obj.SOCorCOC);
                    });
                }
                else if (element.id == 'status') {
                    tableData = tableData.filter(function (obj) {
                        return (element.name !== obj.status);
                    });
                }
            }
        });
        this.tableDataMaintainJoSearch = tableData;
    };
